@import url("https://fonts.googleapis.com/css2?family=Roboto:ital,wght@0,100;0,300;0,400;0,500;0,700;0,900;1,100;1,300;1,400;1,500;1,700;1,900&family=Titillium+Web:ital,wght@0,200;0,300;0,400;0,600;0,700;0,900;1,200;1,300;1,400;1,600;1,700&display=swap");

/* -- GENERAL -------------------------- */
html,
body {
  margin: 0;
  padding: 0;
  font-family: sans-serif;
}
* {
  font-family: "Titillium Web";
  box-sizing: border-box;
  max-width: 100%;
}
.clear {
  clear: both;
}

/* -- PRINT SETUP ---------------------- */
@page {
  margin: 0 0 0 0;
}
body {
  max-width: 23cm;
  margin: auto;
}
#print-table table td,
#print-table table th {
  border: 1.5px solid black;
  border-collapse: collapse;
}
#print-table > thead > tr {
  background: none;
}
#print-table > thead > tr > td,
#print-table > tbody > tr > td,
#print-table > tfoot > tr > td {
  padding: 0;
}
#print-table > thead > tr > td {
  padding-bottom: 50px;
}
#print-table > tfoot > tr > td {
  padding-top: 20px;
}

/* -- TYPO ----------------------------- */
p {
  margin: 0;
  padding: 0;
  line-height: 1.2em;
  margin-bottom: 0.2em;
}

/* -- STYLING --------------------------- */
#time-header {
  background: #c7c8ca;
}
#time-header img {
  float: right;
  max-height: 3.1cm;
  padding: 0.8cm 1.2cm;
}
#address-company {
  padding-top: 1.11cm;
  padding-left: 1.2cm;
}
#time-info {
  float: right;
  width: 8cm;
  padding-right: 1.2cm;
}
#time-content {
  clear: both;
  padding-top: 0.8cm;
  padding-left: 1.1cm;
  padding-right: 1.1cm;
}

/* -- DESCRIPTION ----------------------- */
.description {
  float: left;
  width: 4cm;
}
.description .value {
  float: left;
}
.value + .description {
  clear: both;
  line-height: 1em;
}
.value + .description + .value {
  line-height: 1em;
}

/* -- TABLES ---------------------------- */
table {
  width: 100%;
  border-collapse: collapse;
}
thead tr {
  background: #c7c8ca;
}
td,
th {
  padding: 0.1cm 0.1cm 0.05cm 0.1cm;
}
td:last-child {
  width: 2.95cm;
}

/* -- FOOTER ---------------------------- */
.footer {
  padding: 0.1cm 1.2cm;
  padding-bottom: 0.9cm;
  display: flex;
  justify-content: space-between;
}
.table-footer {
  visibility: hidden;
}
@media print {
  .real-footer {
    position: fixed;
    left: 0;
    bottom: 0;
    right: 0;
  }
}
